import logo from './logo.svg';
import './App.css';
import { Route, Redirect, Switch, BrowserRouter } from 'react-router-dom';
import HomePage from './pages/HomePage/HomePage';
const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route component={HomePage} ></Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
